import React, { useState, useEffect } from "react";
import Web3 from "web3";
import "./App.css";


function Navbar() {

    return(
        
        <div id="navContainer" className="">
        <div id="electionComissionLogo"></div>
        <div id="headlines">
        <ul id="headlinesTable">
        <li id="hindiLine"></li>
        <li id="englishLine"></li>
        </ul>
        </div>
        <div id="indianFlag"></div>
        <div id="nationalEmblem"></div>
        
        </div>
        

    )
}


export default Navbar();
